import React, { useState, useEffect } from 'react';
import { getApplications, getAppConfig } from '../api';
import './Applications.css';

export default function Applications() {
    const [apps, setApps] = useState([]);
    const [selectedApp, setSelectedApp] = useState(null);
    const [configData, setConfigData] = useState({ columns: [], rows: [] });
    const [selectedTab, setSelectedTab] = useState(null);
    const [loading, setLoading] = useState(false);



    useEffect(() => {
        loadApplications();
    }, []);

    const loadApplications = async () => {
        try {
            const { data } = await getApplications();
            setApps(data);
        } catch (err) {
            console.error('Fehler beim Laden der Anwendungen:', err);
        }
    };

    const handleAppClick = async (app) => {
        setSelectedApp(app);
        setLoading(true);
        setSelectedTab(null);
        try {
            const response = await getAppConfig(app.key);
            const { columns, rows } = response.data;
            setConfigData({ columns, rows });

            // Optional: Erste config_key als Tab auswählen (falls vorhanden)
            const keys = rows.map(r => r.config_key).filter(Boolean);
            if (keys.length > 0) {
                setSelectedTab(keys[0]);
            }
        } catch (err) {
            console.error('Fehler beim Laden der Konfiguration:', err);
            setConfigData({ columns: [], rows: [] });
        } finally {
            setLoading(false);
        }
    };


    return (
        <div className="applications-container">
            <div className="sidebar">
                <h3>Anwendungen</h3>
                {apps.map(app => (
                    <button
                        key={app.id}
                        className={`app-btn ${selectedApp?.key === app.key ? 'active' : ''}`}
                        onClick={() => handleAppClick(app)}
                    >
                        {app.name}
                    </button>
                ))}
            </div>

            <div className="main">
                {loading && <p>Lade Konfiguration...</p>}

                {!loading && selectedApp && (
                    <>
                        <h2>{selectedApp.name} – Konfiguration</h2>
                        <div className="tabs">
                            {[...new Set(configData.map(conf => conf.config_key))].map(key => (
                                <button
                                    key={key}
                                    className={`tab-btn ${selectedTab === key ? 'active' : ''}`}
                                    onClick={() => setSelectedTab(key)}
                                >
                                    {key}
                                </button>
                            ))}
                        </div>


                        <div className="config-details">
                            {configData
                                .filter(c => c.config_key === selectedTab)
                                .map(conf => (
                                    <div key={conf.id} className="config-entry">
                                        <div><strong>ID:</strong> {conf.id}</div>
                                        <div><strong>Config Key:</strong> {conf.config_key}</div>
                                        <div><strong>Config Description:</strong> <input type="text" name="" value={String(conf.description)} /></div>
                                        <div><strong>Preis pro Nacht:</strong> <input type="text" name="" value={String(conf.preisNacht)} /></div>
                                        <div><strong>Preis pro Woche:</strong> <input type="text" name="" value={String(conf.preisWoche)} /></div>
                                        <div><strong>Preis pro Monat:</strong> <input type="text" name="" value={String(conf.preisMonat)} /></div>
                                        <div><strong>Belegt:</strong> <input type="text" name="" value={String(conf.belegt)} /></div>
                                        <div><strong>Zuletzt aktualisiert:</strong> {new Date(conf.updated_at).toLocaleString()}</div>
                                    </div>
                                ))}
                        </div>

                    </>
                )}
            </div>
        </div>
    );
}
